import { userRegister_Success } from '../../constants/constants'

export const addUser = (username, password, email) => async (dispatch) => {
    await fetch(`http://localhost:3000/user/?username=${username}&password=${password}&email=${email}`)
    .then((response) => response.json())
    .then((result) => {
        dispatch ({
            type: userRegister_Success,
            payload: result
        })
    })
    .catch((err) => err.message)
}
